// ==========================================
// ১. Modal এবং Scroll Logic
// ==========================================

// Function to open a modal (Updated to use 'flex' for centering)
function openModal(modalId) {
    const modal = document.getElementById(modalId);
    if(modal) modal.style.display = "flex"; 
}

// Function to close a modal
function closeModal(modalId) {
    const modal = document.getElementById(modalId);
    if(modal) modal.style.display = "none";
}

// Close modal if user clicks outside of the modal content
window.onclick = function(event) {
    const modals = document.getElementsByClassName('modal');
    for (let i = 0; i < modals.length; i++) {
        // Ensure the event target is the modal backdrop, not the content inside
        if (event.target == modals[i]) {
            modals[i].style.display = "none";
        }
    }
}

// Smooth scroll for footer links
document.querySelectorAll('.glass-footer a').forEach(anchor => {
    anchor.addEventListener('click', function (e) {
        e.preventDefault();

        const targetId = this.getAttribute('href');
        const targetElement = document.querySelector(targetId);

        if (targetElement) {
             window.scrollTo({
                top: targetElement.offsetTop - 20,
                behavior: 'smooth'
            });
        }
    });
});


// ==========================================
// ২. উন্নত স্লাইডার লজিক (Improved Slider Logic)
// ==========================================
window.addEventListener('load', () => {
    const slider = document.querySelector('.slider');
    if (!slider) return;

    const slides = Array.from(slider.querySelectorAll('img'));
    if (slides.length <= 1) return;

    // Clone first and last slides for infinite loop effect
    const firstClone = slides[0].cloneNode(true);
    const lastClone = slides[slides.length - 1].cloneNode(true);

    slider.appendChild(firstClone);
    slider.insertBefore(lastClone, slides[0]);

    const allSlides = Array.from(slider.querySelectorAll('img'));
    const slideCount = allSlides.length;
    let currentIndex = 1; // Start at the first real slide
    let intervalId;

    function updateSlider(transition = true) {
        if (!slider) return;
        const containerWidth = slider.parentElement.clientWidth;
        const offset = -currentIndex * containerWidth;
        
        slider.style.transition = transition ? 'transform 1s ease-in-out' : 'none';
        slider.style.transform = `translateX(${offset}px)`;
    }

    function nextSlide() {
        if (currentIndex >= slideCount - 2) {
             // Immediately jump to the start of the real slides when the last real slide is passed
             currentIndex++;
             updateSlider();
        } else {
            currentIndex++;
            updateSlider();
        }
    }

    function startSlider() {
        intervalId = setInterval(nextSlide, 4000);
    }

    slider.addEventListener('transitionend', () => {
        // When it reaches the cloned first image (at the end)
        if (currentIndex === slideCount - 1) {
            currentIndex = 1;
            updateSlider(false); // Jump to the first real slide without transition
        }
        // When it reaches the cloned last image (at the beginning)
        if (currentIndex === 0) {
            currentIndex = slideCount - 2;
            updateSlider(false); // Jump to the last real slide without transition
        }
    });

    // Initial setup
    updateSlider(false); // Go to initial position without animation
    startSlider();

    window.addEventListener('resize', () => updateSlider(false));
});


